        <Modal open={open} setOpen={setOpen}>
          <img
            src="https://c.tenor.com/2B3r0f7Vvg4AAAAd/%D1%83%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0.gif"
            alt={'images'}
